import React from "react";
import { useNavigate } from "react-router-dom";
const Login = ({name}) =>{
    const navigate = useNavigate()
    if(name !== "user"){
        throw new Error("something went wrong!!")
    }
    const Login = () =>{
        navigate('/')
    }
    return(
        <div>
            <h2>Login {name}</h2>
            <button onClick={Login}>Login</button>
        </div>
    )
}
export default Login
